  const [type, setType] = useState('');

  const checkType = () => {
    if ({ props } === 'id') setType('text');
    else setType('password');
  };

  return (
    <div>
      <StyledInput
        className='id-input'
        type='text'
        placeholder='아이디를 입력하세요'
        value='id'
      />
    </div>
  );
}
